import { NavLink, useRoutes } from 'react-router-dom'
import './App.css';
// 引入antD库
import {
  HomeOutlined,
  SearchOutlined,
  ShoppingCartOutlined,
  UserOutlined
} from '@ant-design/icons'

// 引入路由表
import routes from './routes'


function App() {
  // 路由表
  const element = useRoutes(routes)
  const items = [
    { path: '/home', title: '首页', icon: <HomeOutlined /> },
    { path: '/search', title: '搜索', icon: <SearchOutlined /> },
    { path: '/shoppingcart', title: '购物车', icon: <ShoppingCartOutlined /> },
    { path: '/my', title: '我的', icon: <UserOutlined /> },
  ]
  return (
    <div className="content">
      {/* 主题内容 */}
      <header className="header">
        {/* 注册路由 */}
        {element}
      </header>
      {/* 导航栏 */}
      <div>
        <div className='footer'>
          <div className='footer-seat'>
            <div className='footer-lists'>
              <ul>
                {
                  items.map(item => {
                    return (
                      <li>
                        <NavLink to={item.path} className={({ isActive }) => isActive ? 'selected' : ''}>
                          {item.icon}
                          <span>{item.title}</span>
                        </NavLink>
                      </li>
                    )
                  })
                }


              </ul>
            </div>
          </div>
        </div>
      </div>
    </div >
  );
}

export default App;
